$templateCache.put("/static/503.html","<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\"> <html> <head> <title>Loading - ThousandEyes</title> <style>#msg {\n    margin-top: 100px;\n    font: 14px Arial, sans-serif;\n    font-style: italic;\n    color: #999;\n    text-align: center;\n    width: 100%;\n}</style> </head> <body> <div id=msg></div> <script>window.onload = function () {\n    var interval = 2000;\n    var tries = +document.cookie.replace(/(?:(?:^|.*;\\s*)teRetries\\s*\\=\\s*([^;]*).*$)|^.*$/, \"$1\");\n    var expires = new Date(new Date().getTime() + (interval * 10)).toGMTString();\n\n    if (tries < 5) {\n        document.getElementById(\'msg\').innerHTML = \'Please wait...\';\n        document.cookie = \'teRetries=\' + (tries + 1) + \';path=/;domain=.thousandeyes.com;max-age=\' + (interval * 10 / 1000) + \';expires=\' + expires;\n        setTimeout(function () { location.reload(); }, interval);\n    }\n    else {\n        document.getElementById(\'msg\').innerHTML = \'Sorry, ThousandEyes is temporarily unavailable.<br/>\' +\n            \'If the problem persists, please contact <a href=\"mailto:support@thousandeyes.com\">support@thousandeyes.com</a>.\';\n    }\n};</script> </body> </html>");
